text:
1 of the 1st things I learned in #rstats was how to use an ellipsis.

https://t.co/PXXNyq2rHT

Turns out you do that in #python with **kwargs!

def mysum(a, b, n):
    return a + b + n
mysum(1, 2, 3) # 6

def add5(n=5, **kwargs):
    return mysum(n=n, **kwargs)
add5(a=1, b=2) # 8 https://t.co/aRu9mma8p2

